import logo from './logo.svg';
import React from 'react';
import { Routes, Route } from "react-router-dom";
import Main from "./pages/Main.jsx";

import './App.css';

function App() {
  return (
    <div>
      <Routes>
        <Route path="/" element={<Main />}></Route>
      </Routes>
    </div>
  );
}

export default App;
